	[character]
	_addr="0x1bd7dc80"
	current_frame="normal"
	custom="yes"
	face_right="yes"
	label="mortimer_mole"
	on_talk="[if((not level.player.vars.mortimer_state),	
	  speech_dialog(set(level.player.vars.mortimer_state, 'wants_ant'),
	                self, [~Hello there.~],
							set(level.player.animation, 'emote_raisedfinger'),
							level.player, [~Hi, I'm Frogatto.~],
							self, [~A pleasure to meet you.~,~I am Mortimer.~],
							set(level.player.animation, 'emote_talk'),
							level.player, [~That's nice.~],
										set(level.player.animation, 'emote_confused'),
										[~Uhm, I hope you don't mind my asking,~,~but what on earth ARE you, anyway?~],
							self, [~Ostensibly, I am a mole.~],
							set(level.player.animation, 'emote_talk'),
							level.player, [~...~,~Okay.~],
							self, [~Perhaps more importantly, I am a bit of~,~an astronomer and biologist, by trade.~],
									[~That is why I live all the way up here.~,~You can see quite a bit from this height.~],

							level.player, [~...and I guess you have these~,
							               ~ants in cages to study them?~],
							self, [~That's right. Unfortunately, my~,
							       ~collection lacks the rarer~,
								   ~golden ant.~],
							level.player, [~Oh, what a shame.~],
							self, [~You know, you look rather well-traveled.~,
							       ~If you could bring me a golden ant~,
								   ~and stick it in one of my cages,~,
								   ~I'd reward you handsomely.~],
							level.player, [~Handsomely you say?~,
							               ~I'm on it!~])),
	if(level.player.vars.mortimer_state = 'wants_ant',
	   if(level.player.vars.got_gold_ant,
	    speech_dialog(self, [~Oh! You got the golden ant for me.~,
		                     ~It's beautiful, beautiful!~],
		              level.player, [~Mmmmmhmmmm. Now you were talking~,
					                 ~about a reward?~],
					  self, [~Oh yes, a reward!~, ~Here you go...~],
					  spawn('max_heart_object', midpoint_x - 40, midpoint_y, facing),
					  spawn('die_cloud', midpoint_x - 40, midpoint_y, facing),
					  set(level.player.vars.mortimer_state, 'got_ant')),
		speech_dialog(self, [~I don't suppose you've had any~,
		                     ~luck with getting a golden ant yet?~],
		              level.player, [~I'm working on it.~,
					                 ~Those things pack a pretty mean~,
									 ~bite, you know.~]
	   ))),
	 if(level.player.vars.mortimer_state = 'got_ant',
	   speech_dialog(self, [~I do hope you are enjoying exploring~,
	                        ~the island. There are so many~,
							~wonderful creatures on it.~],
		             level.player, [~I'm assuming you're talking about~,
					                ~all the creatures that keep trying~,
									~to kill me.~]))
	]"
